m a visão de futuro da Universidade, conduta de transparência e acompanhamento do uso dos resultados nos processos de tomada de decisões e de planejamento de ações. As perspectivas se encontram ancoradas por um conjunto de pressupostos.</p>","","\t\t<h3>Departamentos envolvidos na CSA-CCNE</h3>","\t\t","\t\t<ul>","\t\t\t<li><a target='_blank' href='www.ufsm.br/depgeo'> Biologia</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/estat'> Estatística</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/dfisica'> Física</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/depgeo'> Geografia</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/depmat'> Matemática</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/quimica'> Química</a></li>","\t\t\t<li><a target='_blank' href='www.ufsm.br/assufsm'> TAE's</a></li>","\t\t</ul>","",""]},{"action":"insertText","range":{"start":{"row":0,"column":0},"end":{"row":0,"column":1}},"text":"<"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":1},"end":{"row":0,"column":2}},"text":"?"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":2},"end":{"row":0,"column":3}},"text":"p"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":3},"end":{"row":0,"column":4}},"text":"h"},{"action":"insertText","range":{"start":{"row":0,"column":4},"end":{"row":0,"column":5}},"text":"p"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":5},"end":{"row":0,"column":6}},"text":" "}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":6},"end":{"row":0,"column":7}},"text":"?"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":0,"column":7},"end":{"row":0,"column":8}},"text":">"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":22,"column":145},"end":{"row":22,"column":146}},"text":" "}]}],[{"group":